import React from "react";

export const ContactPicker = ({contacts, setContact, value, name}) => {
  return (
    <div>
      <select
        onChange={(e) => setContact(e.target.value)}
        value={value}
        name={name}
        required >
        <option value="" selected>No Contact Selected</option>

      </select>

      
    </div>
  );
};
